INSERT INTO `products` VALUES (90,'Me O Creamy Salmon Cat Treats 300g','Me-O Creamy Salmon Cat Treats (300g) are a delicious and healthy choice for rewarding your cat with love and nutrition. Made with real salmon, these creamy treats are packed with protein to help build strong muscles, while taurine supports healthy vision and heart function. Enriched with essential vitamins, minerals, and Omega-6 with zinc, they boost immunity, promote shiny fur, and maintain soft, healthy skin. With their smooth, creamy texture and rich salmon flavor, these treats are perfect for daily snacking, training, or strengthening your bond with your cat.\r\n',425,10,'https://supertails.com/cdn/shop/products/Frame1_b8303cb8-c6e5-43ac-842c-3876f2a30e6e-207141_600x.png?v=1722326160','2025-10-03 10:45:28','0.3',119,2,1,NULL,382.5),(92,'Sheba Premium Fish Mix Maguro & Bream Wet Cat Food 35g','Sheba Premium Fish Mix Maguro & Bream Wet Cat Food (35g) is a luxurious blend of tender maguro (tuna) and bream, crafted to deliver an irresistible taste and rich nutrition for your cat. Packed with high-quality protein and essential nutrients, this premium wet food supports strong muscles, vitality, and overall wellbeing, while its moist texture helps maintain healthy hydration. Perfect as a complete meal or a delightful treat, Sheba ensures a safe, wholesome dining experience by being free from artificial flavors, colors, and preservatives—making every mealtime a gourmet indulgence for your cat.\r\n',50,10,'https://m.media-amazon.com/images/I/71ehZaFPeOL._SL1500_.jpg','2025-10-03 10:48:09','pack of 9',NULL,2,1,NULL,45),(93,'Matisse Dry Kitten Food 10kg','Matisse Dry Kitten Food (10kg) is a premium, complete, and balanced diet crafted to support the healthy growth and development of kittens. With high-quality chicken, fish, and rice, it delivers the right amount of protein for muscle development and energy, while taurine ensures strong heart function and good vision. Fortified with essential vitamins, minerals, and omega fatty acids, it strengthens immunity, promotes strong bones, and keeps your kitten’s coat shiny and healthy. Highly digestible and tasty, this large 10kg pack is an ideal long-term nutrition solution for growing kittens or multi-kitten households.\r\n',7850,1,'https://m.media-amazon.com/images/I/71d9j2UCkCS._SL1500_.jpg','2025-10-03 10:54:18','10',249,2,1,NULL,NULL),(94,'Whiskas Salmon in Gravy Meal Adult Cat Wet Food 80g (pack of 14)','Whiskas Salmon in Gravy Meal Adult Cat Wet Food (80g × 14 pouches) is a tasty and nutritious meal specially designed for adult cats aged 1 year and above. Made with real salmon in a rich, savory gravy, it provides high-quality protein along with essential vitamins, minerals, taurine, and omega fatty acids to support strong muscles, good eyesight, healthy skin, and a glossy coat. Its high moisture content helps maintain hydration, while the delicious aroma and flavor make it highly appealing, even for picky eaters. Convenient single-serve pouches ensure freshness, easy feeding, and a satisfying mealtime every day.\r\n',700,1,'https://m.media-amazon.com/images/I/41GuJALqOGL._SY300_SX300_QL70_FMwebp_.jpg','2025-10-03 10:56:52',NULL,NULL,2,1,NULL,NULL),(95,'Farmina N&D Quinoa Urinary Duck Adult Cat Food 300g','Farmina N&D Quinoa Urinary Duck Adult Cat Food (300g) is a premium functional diet crafted to support urinary health in adult cats. Made with high-quality duck as the primary protein source, it provides lean nutrition while quinoa, cranberry, and chamomile help maintain a healthy urinary tract and reduce the risk of urinary infections. Grain-free and rich in natural antioxidants, this formula ensures easy digestion, balanced nutrition, and overall well-being, making it an ideal choice for cats prone to urinary issues.\r\n',750,1,'https://m.media-amazon.com/images/I/51upA1pUrpL._SY300_SX300_QL70_FMwebp_.jpg','2025-10-03 10:59:17','0.3',NULL,2,1,NULL,NULL),(96,'Whiskas Mackerel Flavour Adult Cat Dry Food 480g','Whiskas Mackerel Flavour Adult Cat Dry Food (480 g) is a complete and balanced meal specially formulated for adult cats aged 1 year and above, offering the delicious taste of mackerel in every crunchy bite. Enriched with high-quality protein, essential vitamins, and minerals, it supports strong muscles, healthy bones and teeth, and promotes a shiny coat with the goodness of Omega-6 and zinc. The crunchy kibbles help maintain dental hygiene, while balanced minerals support urinary tract health—keeping your cat healthy, active, and full of energy every day.\r\n',235,1,'https://m.media-amazon.com/images/I/418b6ZnZpsL._SY300_SX300_QL70_FMwebp_.jpg','2025-10-03 12:36:54','0.48',NULL,2,1,NULL,NULL),(97,'Whiskas Chicken with Salmon in Jelly Kitten (2-12 Months) Cat Wet Food 80g (pack of 14)','Whiskas Chicken with Salmon in Jelly Kitten Wet Food (80g × 14 pouches) is specially formulated for kittens aged 2–12 months, providing complete and balanced nutrition for healthy growth and development. Made with tender chicken and salmon chunks in a tasty jelly, it delivers high-quality protein to support strong muscles, essential vitamins and minerals for bone and immune health, and DHA for brain development. The jelly texture keeps kittens hydrated and makes every meal irresistible, while the convenient single-serve packs ensure freshness and easy feeding. Perfect for giving your little kitten the best start in life.\r\n',700,1,'https://m.media-amazon.com/images/I/51XDdLnDTWL._SY300_SX300_QL70_FMwebp_.jpg','2025-10-03 12:39:07','pack of 14',NULL,2,1,NULL,NULL),(98,'Royal Canin Second Age Dry Kitten Food 2kg','Royal Canin Second Age Dry Kitten Food (1.2kg) is a premium formula specially designed for kittens up to 12 months old, ensuring healthy growth and development during their crucial second stage of life. It provides high-quality proteins, essential vitamins, and minerals to support strong bones, muscles, and overall vitality. Enriched with antioxidants, including vitamin E, it boosts natural immunity, while DHA supports brain and vision development. Its small, easy-to-chew kibble suits tiny jaws and promotes dental health. This 1.2kg pack offers complete, balanced nutrition to keep your kitten active, healthy, and thriving every day.\r\n',2210,1,'https://m.media-amazon.com/images/I/31mNLSFVwAL._SY300_SX300_QL70_FMwebp_.jpg','2025-10-03 12:39:32','2',226,2,1,NULL,NULL),(99,'Whiskas Tuna & White Fish Adult (1+ Years) Cat Wet Food 80g ( pack of 14)','Whiskas Tuna & White Fish Adult Cat Wet Food (80g × 14 pouches) is a delicious and nutritious meal designed for cats aged 1 year and above. Made with real tuna and white fish in a tasty gravy, it provides high-quality protein to support strong muscles and overall health. Enriched with essential vitamins, minerals, and taurine, it helps maintain a healthy heart, sharp eyesight, and a strong immune system. The gravy texture also supports hydration, keeping your cat refreshed and satisfied. Convenient single-serve pouches make mealtime easy, ensuring your cat enjoys fresh, balanced nutrition with every serving.\r\n',700,1,'https://m.media-amazon.com/images/I/81AW4EKc2AL._SL1500_.jpg','2025-10-03 12:39:56',NULL,NULL,2,1,NULL,NULL),(100,'Whiskas Tasty Mix Chicken Tuna with Sweet Potato Kitten Cat Wet Food 70g (pack of 56)','Whiskas Tasty Mix Chicken & Tuna with Sweet Potato Kitten Wet Cat Food (70g × 56 pouches) is a nourishing and delicious meal crafted to meet the nutritional needs of growing kittens. With a blend of tender chicken, protein-rich tuna, and nutrient-dense sweet potato, it provides essential proteins, vitamins, and minerals for strong bones, healthy growth, and a shiny coat. The flavorful gravy keeps kittens hydrated and makes mealtime irresistible, while the convenient single-serve pouches ensure freshness in every meal. This wholesome recipe supports overall development and helps your kitten grow into a healthy, active adult cat.\r\n',2800,1,'https://m.media-amazon.com/images/I/51YlE